// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.5.0 < 0.9.0 ;

// storage
// stored on blockchain directly
// permanent
// requires gas

// memory
// local variables
// inside stack or ram
// less gas(almost negligible)
// function finished then variables also finished
contract A{

function Memory(string memory str , uint[] memory arr) public {
getinMem(arr);
// getinCall(arr); memory type cant be passed to calldata type
// storage to storage and storage to memory works
// call to memory works
// call to call ofc works
// call to call less gas than call to memory

}


function CallData(string calldata str , uint[] calldata arr) public {

    getinMem(arr);
getinCall(arr); 
}


function getinMem(uint[] memory arr) public {

}

function getinCall(uint[] calldata arr) public {

}

// in memory u can change the value of str and name
// but in call data u cant
// so call data has even less gas than memory

}

